/**
 * Build_Sanitized_NDJSON - strict mode for config values
 * UPDATED: Uses output_text from Final Decision as primary source
 */

function err(msg){ throw new Error(msg); }

function simpleHash(str){
  let hash = 0;
  for (let i = 0; i < str.length; i++){
    const c = str.charCodeAt(i);
    hash = ((hash << 5) - hash) + c;
    hash |= 0;
  }
  return hash.toString(36);
}

const isPlainObject = v => Object.prototype.toString.call(v) === "[object Object]";
function firstDefined(...vals){ for (const v of vals) if (v !== undefined && v !== null) return v; return undefined; }
function s(v){ if (v===undefined||v===null) return undefined; const t=String(v); return t.trim()?t:undefined; }
function deepPrune(value,{removeEmptyObjects=false,removeEmptyArrays=false}={}){
  if (Array.isArray(value)){
    const arr = value.map(v=>deepPrune(v,{removeEmptyObjects,removeEmptyArrays})).filter(v=>v!==undefined);
    if (removeEmptyArrays && arr.length===0) return undefined;
    return arr;
  }
  if (isPlainObject(value)){
    const out = {};
    for (const [k,v] of Object.entries(value)){
      const pruned = deepPrune(v,{removeEmptyObjects,removeEmptyArrays});
      if (pruned !== undefined) out[k]=pruned;
    }
    if (removeEmptyObjects && Object.keys(out).length===0) return undefined;
    return out;
  }
  if (value===null || value===undefined || (typeof value==="number" && Number.isNaN(value))) return undefined;
  return value;
}
function J(x){ try { return JSON.stringify(x ?? {}); } catch { return "{}"; } }

const items = $input.all();
if (!items.length) err("Build_Sanitized_NDJSON: no input items.");

const out = [];

for (const item of items){
  const j = item.json || {};

  const san = j.__san || {};
  const snap = j._pipeline_snapshots || san._pipeline_snapshots || {};
  const norm = j.normalization || san.normalization || {};

  const pgDecision = j.decision || {};
  const routing = j.routing || {};
  const metrics = j.metrics || {};
  const technical = j.technical || {};
  const audit = j.audit || {};
  const messages = j.messages || {};

  const sanitizerDecision = j.sanitizer_decision || {};

  const cfg = j.config || {};
  const rules = j.rules || {};
  const thr = j.thresholds || {};

  const sessionId = firstDefined(
    j.sessionId,
    san.sessionId,
    j.chat_payload?.sessionId
  ) || "unknown";

  const action = firstDefined(
    j.action,
    san.action,
    j.chat_payload?.action
  ) || "sendMessage";

  const originalInput = s(firstDefined(
    snap.beforeSanitization,
    norm?.original,
    san.chat_payload?.chatInput,
    j.audit?.originalPrompt
  )) || "N/A";

  const normalizedInput = s(firstDefined(
    snap.input_normalized,
    norm?.canonical,
    norm?.normalized,
    originalInput
  )) || originalInput;

  const sanitizedText = s(firstDefined(
    snap.afterSanitization,
    san.chat_payload?.chatInput,
    j.chat_payload?.chatInput
  ));

  const redactedText = s(firstDefined(
    snap.afterPII,
    sanitizedText
  ));

  const pgShouldBlock = !!(routing.shouldBlock || j._isBlocked);
  const pgShouldWarn = !!(routing.shouldWarn || j._requiresSanitization);
  const pgIsSafe = !!(routing.isSafe || j._shouldContinue);

  const sanitizerDecisionStr = sanitizerDecision.decision || 'ALLOW';
  const sanitizerBlocked = (sanitizerDecisionStr === 'BLOCK');

  let finalStatus;
  if (pgShouldBlock || sanitizerBlocked) {
    finalStatus = "BLOCKED";
  } else if (pgShouldWarn) {
    finalStatus = "SANITIZED";
  } else {
    finalStatus = "ALLOWED";
  }

  const shouldBlock = (finalStatus === "BLOCKED");
  const shouldWarn = (finalStatus === "SANITIZED");
  const isSafe = (finalStatus === "ALLOWED");

  // ✓ UPDATED: Priorytet dla output_text z Final Decision
  const finalOutput = s(j.output_text) || 
                      (shouldBlock 
                        ? (s(messages?.user) || s(cfg?.enforcement?.block_message) || "Content blocked by security policy")
                        : (redactedText || sanitizedText || s(j.chat_payload?.chatInput) || "N/A"));

  const pgHasDecision = !!(pgDecision && (pgDecision.action !== undefined || pgDecision.severity !== undefined || pgDecision.scoreRaw !== undefined));
  const blockedByPG = shouldBlock && pgHasDecision;
  const blockedBySan = shouldBlock && !pgHasDecision;

  let source = "sanitizer_pre_pg";
  let actionTaken = firstDefined(pgDecision.action, finalStatus);

  if (finalStatus === "BLOCKED"){
    if (blockedBySan) { 
      source = "sanitizer_only"; 
      actionTaken = "BLOCK_BY_SANITIZER"; 
    }
    if (blockedByPG) { 
      source = "prompt_guard"; 
      actionTaken = pgDecision.action || "BLOCK_BY_PROMPT_GUARD"; 
    }
  } else {
    source = pgHasDecision ? "prompt_guard" : "sanitizer_pre_pg";
    if (finalStatus === "ALLOWED") actionTaken = "ALLOW";
    if (finalStatus === "SANITIZED") actionTaken = actionTaken || "SANITIZE";
  }

  const nd = {
    sessionId,
    action,
    chat_payload: {
      sessionId,
      action,
      chatInput: finalOutput
    },
    sanitizer: {
      decision: sanitizerDecisionStr,
      removal_pct: san.enforcement?.removalPct ?? j.enforcement?.removalPct ?? 0,
      mode: san.enforcement?.mode || j.enforcement?.mode,
      score: j.score || sanitizerDecision.score || 0,
      breakdown: j.scoreBreakdown || sanitizerDecision.scoreBreakdown || {}
    },
    prompt_guard: pgHasDecision ? {
      score: pgDecision.scoreRaw || metrics.injectionScore,
      score_percent: pgDecision.scorePercent || metrics.scorePercent,
      risk_level: pgDecision.riskLevel,
      severity: pgDecision.severity,
      action: pgDecision.action,
      should_block: pgShouldBlock,
      should_warn: pgShouldWarn,
      is_safe: pgIsSafe,
      confidence: metrics.confidence,
      thresholds_used: technical.thresholdsUsed,
      policies_used: technical.policiesUsed,
      timestamp: audit.timestamp
    } : {},
    final_decision: {
      status: finalStatus,
      blocked: shouldBlock,
      sanitized: shouldWarn,
      allowed: isSafe,
      action_taken: actionTaken,
      user_message: s(messages?.user) || "",
      internal_note: s(messages?.internal) || "",
      source
    },
    pipeline_flow: {
      input_raw: originalInput,
      input_normalized: normalizedInput,
      after_sanitization: sanitizedText || finalOutput,
      after_pii_redaction: redactedText || finalOutput,
      output_final: finalOutput,
      output_status: finalStatus
    },
    scoring: {
      sanitizer_score: Number(j.score ?? sanitizerDecision.score ?? 0),
      prompt_guard_score: pgDecision.scoreRaw || metrics.injectionScore,
      prompt_guard_percent: pgDecision.scorePercent || metrics.scorePercent,
      combined_severity: firstDefined(
        pgDecision.severity,
        (j.score ?? 0) >= 76 ? 5 :
        (j.score ?? 0) >= 56 ? 4 :
        (j.score ?? 0) >= 30 ? 3 :
        (j.score ?? 0) >= 10 ? 2 : 1
      ),
      score_breakdown: j.scoreBreakdown || sanitizerDecision.scoreBreakdown || {},
      match_details: j.matchDetails || []
    },
    config_metadata: {
      config_hash: (cfg && rules && thr) ? simpleHash(JSON.stringify({ cfg, rules, thr })) : "no-config",
      config_version: cfg?.version || "unknown",
      has_full_config: !!(cfg && rules && thr),
      has_prompt_guard: pgHasDecision,
      config_ref: {
        normalization_unicode: cfg.normalization?.unicode_form,
        scoring_ranges: thr?.ranges,
        prompt_guard_thresholds: technical.thresholdsUsed
      },
      loader_info: j._loader
    },
    _audit: {
      processing_timestamp: new Date().toISOString(),
      pipeline_version: "v2.2-merged",
      total_processing_time: metrics.processingTime,
      final_action: actionTaken
    }
  };

  const ndClean = deepPrune(nd);

  const row = {
    sessionId: ndClean.sessionId,
    action: ndClean.action,
    timestamp: ndClean._audit?.processing_timestamp,

    original_input: ndClean.pipeline_flow?.input_raw,
    normalized_input: ndClean.pipeline_flow?.input_normalized,
    after_sanitization: ndClean.pipeline_flow?.after_sanitization,
    after_pii_redaction: ndClean.pipeline_flow?.after_pii_redaction,
    chat_input: ndClean.chat_payload?.chatInput,
    result: ndClean.pipeline_flow?.output_final,

    threat_score: ndClean.scoring?.prompt_guard_score ?? 0,
    threat_severity: ndClean.prompt_guard?.risk_level ?? "UNDEFINED",
    pg_score: ndClean.prompt_guard?.score ?? 0,
    pg_score_percent: ndClean.prompt_guard?.score_percent ?? 0,
    final_status: ndClean.final_decision?.status ?? "UNKNOWN",
    final_action: ndClean._audit?.final_action ?? "",
    user_message: ndClean.final_decision?.user_message ?? "",

    removal_pct: ndClean.sanitizer?.removal_pct ?? 0,
    threat_labels: [],
    threat_matches: [],

    config_version: ndClean.config_metadata?.config_version,
    config_hash: ndClean.config_metadata?.config_hash,
    pipeline_version: ndClean._audit?.pipeline_version,
    processing_time_ms: ndClean._audit?.total_processing_time ?? 0,

    sanitizer_json: J(ndClean.sanitizer),
    prompt_guard_json: J(ndClean.prompt_guard),
    scoring_json: J(ndClean.scoring),
    final_decision_json: J(ndClean.final_decision),
    pipeline_flow_json: J(ndClean.pipeline_flow),
    config_metadata_json: J(ndClean.config_metadata),
    raw_event: J(ndClean)
  };

  out.push({ json: { ndjson: ndClean, row } });
}

return out;

/**
 * Load_Config - Production version with Bloom validation
 * FIXED: English messages, better error handling, bloom configuration validation
 */

function safeParseJson(value, fieldName) {
  if (value == null) {
    return { ok: false, error: `${fieldName} is null/undefined` };
  }

  if (typeof value === 'object') {
    return { ok: true, data: value };
  }

  if (typeof value === 'string') {
    try {
      return { ok: true, data: JSON.parse(value) };
    } catch (e) {
      return { ok: false, error: `${fieldName} JSON parse failed: ${e.message}` };
    }
  }

  return { ok: false, error: `${fieldName} has invalid type: ${typeof value}` };
}

function validateAllowlistSchema(obj) {
  return obj && typeof obj === 'object' && 
    (obj.$schema || obj.title === 'Sanitizer Allowlist Schema');
}

function validateNormalizeConf(text) {
  return typeof text === 'string' && 
    (/#\s*normalize\.conf/i.test(text) || 
     /\\u200B=|leet\.char\.|# Zero-width|# LEET map/.test(text));
}

function validatePiiConf(obj) {
  return obj && typeof obj === 'object' && 
    Array.isArray(obj.rules) && 
    obj.rules.length > 0 &&
    obj.rules.some(r => r && typeof r.pattern === 'string' && typeof r.name === 'string');
}

function validateThresholds(obj) {
  return obj && typeof obj === 'object' && 
    obj.ranges && 
    obj.ranges.allow && 
    obj.ranges.block;
}

function validateUnifiedConfig(obj) {
  return obj && typeof obj === 'object' && 
    obj.normalization && 
    obj.sanitization && 
    obj.scoring;
}

function validateRules(obj) {
  return obj && typeof obj === 'object' && 
    obj.categories && 
    typeof obj.categories === 'object';
}

function validateBloomConfig(config) {
  const warnings = [];

  if (!config.bloom || typeof config.bloom !== 'object') {
    warnings.push('Missing or invalid bloom configuration, using defaults');
  }

  if (!config.prefilter || typeof config.prefilter !== 'object') {
    warnings.push('Missing or invalid prefilter configuration, using defaults');
  }

  if (config.prefilter && !Array.isArray(config.prefilter.dangerous_patterns)) {
    warnings.push('Missing dangerous_patterns in prefilter, will use defaults');
  }

  if (!config.bloom_decisions || typeof config.bloom_decisions !== 'object') {
    warnings.push('Missing bloom_decisions, using defaults');
  }

  return warnings;
}

const inputItems = $input.all();
if (!inputItems || !inputItems.length) {
  console.error('Load_Config: No input items');
  return [{
    json: {
      error: 'No input items',
      configError: true,
      decision: { decision: 'ALLOW', reason: 'CONFIG_ERROR' }
    }
  }];
}

const firstItem = inputItems[0];
const j = firstItem.json ? JSON.parse(JSON.stringify(firstItem.json)) : {};

j._loader = {
  sources: {},
  missing: [],
  errors: [],
  warnings: []
};

const data1Result = safeParseJson(j.data1, 'data1 (allowlist_schema)');
if (data1Result.ok && validateAllowlistSchema(data1Result.data)) {
  j.allowlist_schema = data1Result.data;
  j._loader.sources.allowlist_schema = 'json.data1';
} else {
  j._loader.missing.push('allowlist_schema');
  j._loader.errors.push(data1Result.error || 'data1: invalid allowlist_schema');
}

if (validateNormalizeConf(j.data2)) {
  j.normalization_text = j.data2;
  j._loader.sources.normalize_conf = 'json.data2';
} else {
  j._loader.missing.push('normalize_conf');
  j._loader.errors.push('data2: invalid normalize.conf format');
}

const data3Result = safeParseJson(j.data3, 'data3 (pii.conf)');
if (data3Result.ok && validatePiiConf(data3Result.data)) {
  j.pii_conf = data3Result.data;
  j.pii_text = typeof j.data3 === 'string' ? j.data3 : JSON.stringify(data3Result.data);
  j._loader.sources.pii_conf = 'json.data3';
} else {
  j._loader.missing.push('pii_conf');
  j._loader.errors.push(data3Result.error || 'data3: invalid pii.conf format');
}

const data4Result = safeParseJson(j.data4, 'data4 (thresholds)');
if (data4Result.ok && validateThresholds(data4Result.data)) {
  j.thresholds = data4Result.data;
  j._loader.sources.thresholds = 'json.data4';
} else {
  j._loader.missing.push('thresholds');
  j._loader.errors.push(data4Result.error || 'data4: invalid thresholds format');
}

const data5Result = safeParseJson(j.data5, 'data5 (unified_config)');
if (data5Result.ok && validateUnifiedConfig(data5Result.data)) {
  j.config = data5Result.data;
  j._loader.sources.unified_config = 'json.data5';

  // Validate bloom configuration and collect warnings
  const bloomWarnings = validateBloomConfig(j.config);
  if (bloomWarnings.length > 0) {
    j._loader.warnings = j._loader.warnings.concat(bloomWarnings);
    console.warn('Bloom config warnings:', bloomWarnings);
  }

  // Ensure bloom configuration has required structure
  if (!j.config.bloom) {
    j.config.bloom = { m: 32768, k: 5, seed: 1337, match_mod: 97, min_matched_bits: 2 };
  }

  if (!j.config.prefilter) {
    j.config.prefilter = { 
      ngram: { min: 3, max: 6, prefix_window: 96 },
      sample_limit: 800,
      obf_signals: { min_count: 2 },
      dangerous_patterns: []
    };
  } else if (!j.config.prefilter.dangerous_patterns) {
    j.config.prefilter.dangerous_patterns = [];
  }

  if (!j.config.bloom_decisions) {
    j.config.bloom_decisions = {
      route_to_ac_threshold: 15,
      hard_block_threshold: 50,
      require_zusatz_signals: true,
      phrase_match_bonus: 20
    };
  }

  j.config.references = Object.assign({}, j.config.references || {}, {
    rules_file: 'rules.config.json',
    thresholds_file: 'thresholds.config.json',
    normalize_conf: 'normalize.conf',
    pii_conf: 'pii.conf'
  });
} else {
  j._loader.missing.push('unified_config');
  j._loader.errors.push(data5Result.error || 'data5: invalid unified_config format');
}

const data6Result = safeParseJson(j.data6, 'data6 (rules)');
if (data6Result.ok && validateRules(data6Result.data)) {
  j.rules = data6Result.data;
  j._loader.sources.rules = 'json.data6';
} else {
  j._loader.missing.push('rules');
  j._loader.errors.push(data6Result.error || 'data6: invalid rules format');
}

if (j._loader.missing.length > 0) {
  console.error('Load_Config: Missing required files:', j._loader.missing);
  console.error('Error details:', j._loader.errors);
  if (j._loader.warnings.length > 0) {
    console.warn('Config warnings:', j._loader.warnings);
  }

  return [{
    json: {
      ...j,
      configError: true,
      decision: { decision: 'ALLOW', reason: 'CONFIG_ERROR' },
      error_message: `Missing required files: ${j._loader.missing.join(', ')}`
    },
    pairedItem: 0
  }];
}

if (j._loader.warnings.length > 0) {
  console.info('Config loaded with warnings:', j._loader.warnings);
}

return [{ json: j, pairedItem: 0 }];

/**
 * Normalize_Node - Production version
 * FIXED: Added items declaration, English messages
 */

function parseNormalizeConf(confText) {
  const lines = (confText || "").split(/\r?\n/);
  const map = new Map();
  const leetChar = new Map();
  const leetSingle = new Map();

  for (const raw of lines) {
    const line = raw.trim();
    if (!line || line.startsWith("#")) continue;
    let m;
    if ((m = line.match(/^leet\.single\.([^=]+)=(.*)$/))) {
      leetSingle.set(m[1], m[2]);
      continue;
    }
    if ((m = line.match(/^leet\.char\.([^=]+)=(.*)$/))) {
      leetChar.set(m[1], m[2]);
      continue;
    }
    const eq = line.indexOf("=");
    if (eq >= 0) {
      const lhs = line.slice(0, eq);
      const rhs = line.slice(eq + 1) || '';
      const from = lhs.replace(/\\u\{?([0-9A-Fa-f]{4,6})\}?/g, (_, h) =>
        String.fromCodePoint(parseInt(h, 16)),
      );
      const to = rhs.replace(/\\u\{?([0-9A-Fa-f]{4,6})\}?/g, (_, h) =>
        String.fromCodePoint(parseInt(h, 16)),
      );
      map.set(from, to);
    }
  }
  return { map, leetChar, leetSingle };
}

function stripZeroWidth(s) {
  return s.replace(/[\u200B-\u200F\u202A-\u202E\u2060-\u206F\uFEFF]/g, "");
}

function collapseWhitespace(s) {
  return s.replace(/\s+/g, " ").trim();
}

function hasMathAlnumSymbols(s) {
  for (const ch of s) {
    const cp = ch.codePointAt(0);
    if (cp >= 0x1D400 && cp <= 0x1D7FF) return true;
  }
  return false;
}

function hasMixedLatinCyrillic(s) {
  let latin = false, cyr = false;
  for (const ch of s) {
    const cp = ch.codePointAt(0);
    if (
      (cp >= 0x0041 && cp <= 0x007A) ||
      (cp >= 0x00C0 && cp <= 0x024F)
    ) latin = true;
    if ((cp >= 0x0400 && cp <= 0x04FF) || (cp >= 0x0500 && cp <= 0x052F)) cyr = true;
    if (latin && cyr) return true;
  }
  return false;
}

function htmlDecodeIfNeeded(s, decode) {
  if (!decode) return s;
  return s
    .replace(/&nbsp;/g, " ")
    .replace(/&amp;/g, "&")
    .replace(/&lt;/g, "<")
    .replace(/&gt;/g, ">")
    .replace(/&#(\d+);/g, (_, d) => String.fromCodePoint(parseInt(d, 10)))
    .replace(/&#x([0-9A-Fa-f]+);/g, (_, h) => String.fromCodePoint(parseInt(h, 16)));
}

function applyMap(s, mp) {
  if (!mp || mp.size === 0) return s;
  const keys = [...mp.keys()].sort((a, b) => b.length - a.length);
  for (const k of keys) {
    if (!k) continue;
    const v = mp.get(k);
    const re = new RegExp(k.replace(/[.*+?^${}()|[\]\\]/g, "\\$&"), "g");
    s = s.replace(re, v);
  }
  return s;
}

function casefold(s) {
  return s.toLocaleLowerCase("en");
}

function buildSignals(original, beforeHomoglyphMap, afterLeet, final) {
  const sigs = [];

  if (original.length !== stripZeroWidth(original).length) sigs.push("zero-width-removed");
  if (hasMathAlnumSymbols(original) || hasMathAlnumSymbols(afterLeet)) sigs.push("math-alnum/fraktur");
  if (hasMixedLatinCyrillic(original)) sigs.push("mixed-latin-cyrillic");
  if (/[A-Za-z]/.test(original) && /[0-9]/.test(original) && /[@$%|]/.test(original)) sigs.push("leet-like-mix");

  const separators = beforeHomoglyphMap.match(/(?:_{3,}|-{3,}|\.{3,}|={3,}|\*{3,}){1,}/g);
  if (separators && separators.length >= 3) sigs.push("separator-abuse");

  if (/(?:<\|\/?(system|assistant|user|user_query)\|>|\{\{\s*system\s*\}\}|\[\[\s*system\s*\]\])/.test(beforeHomoglyphMap)) {
    sigs.push("template-markers");
  }

  return sigs;
}

// FIXED: Added items declaration
const items = $input.all();
if (!items || items.length === 0) {
  console.warn('Normalize_Node: No input items');
  return [];
}

const results = [];

for (const item of items) {
  const j = item.json ?? {};
  const cfg = (j.config ?? {});
  const ncfg = cfg.normalization ?? {};
  const confText = j.normalization_text || "";
  const { map, leetChar, leetSingle } = parseNormalizeConf(confText);

  const input =
    j?.chat_payload?.chatInput ??
    j?.chatInput ??
    j?.input ??
    "";

  const steps = [];
  let s = String(input);
  const original = s;

  s = htmlDecodeIfNeeded(s, !!ncfg.decode_entities);
  steps.push({ step: "html_decode", outLen: s.length });

  try {
    s = s.normalize("NFKC");
  } catch {}
  steps.push({ step: "nfkc", outLen: s.length });

  s = casefold(s);
  steps.push({ step: "casefold", outLen: s.length });

  if (ncfg.remove_zero_width !== false) {
    const s0 = s;
    s = stripZeroWidth(s);
    if (s !== s0) steps.push({ step: "strip_zwsp", removed: s0.length - s.length });
  }

  const beforeHomoglyphMap = s;

  s = applyMap(s, map);
  steps.push({ step: "homoglyph_map", outLen: s.length });

  const HEART_PLACEHOLDER = '\uE000HEART\uE001';
  s = s.replace(/<3/g, HEART_PLACEHOLDER);

  if (leetChar.size) {
    for (const [k, v] of leetChar.entries()) {
      if (!k) continue;
      const re = new RegExp(k.replace(/[.*+?^${}()|[\]\\]/g, "\\$&"), "g");
      s = s.replace(re, v);
    }
    steps.push({ step: "leet.char", outLen: s.length });
  }

  s = s.replace(new RegExp(HEART_PLACEHOLDER, 'g'), '<3');

  const afterLeet = s;

  if (leetSingle.size) {
    const tokens = s.split(/(\b)/);
    for (let i = 0; i < tokens.length; i++) {
      const t = tokens[i];
      if (/^\b$/.test(t)) continue;
      const mapped = leetSingle.get(t);
      if (mapped) tokens[i] = mapped;
    }
    s = tokens.join("");
    steps.push({ step: "leet.single", outLen: s.length });
  }

  if (ncfg.collapse_whitespace !== false) {
    s = collapseWhitespace(s);
    steps.push({ step: "collapse_ws", outLen: s.length });
  }

  const canonical = s;
  const forScoring = canonical;

  const signals = buildSignals(original, beforeHomoglyphMap, afterLeet, canonical);

  j._pipeline_snapshots = j._pipeline_snapshots || {};
  j._pipeline_snapshots.input_raw = original;
  j._pipeline_snapshots.input_normalized = canonical;

  j.normalization = {
    original: original,
    normalized: canonical,
    canonical: canonical,
    forScoring: forScoring,
    steps,
    obfuscationSignals: signals,
  };

  j.chat_payload = j.chat_payload || {};
  j.chat_payload.chatInput = canonical;
  j.input_raw = original;

  item.json = j;
  results.push(item);
}

return results;

