function applySanitize(text, patterns, redact) {
  if (!patterns || !patterns.length) return { out: text, removedPct: 0, removedChars: 0 };
  let out = text;
  let removed = 0;
  for (const p of patterns) {
    try {
      const re = new RegExp(p, "giu");
      out = out.replace(re, (m) => {
        removed += m.length;
        return redact || "";
      });
    } catch (e) {
      console.warn(`Invalid sanitization regex: ${p}`, e);
    }
  }
  const removedPct = text.length ? Math.round((removed / text.length) * 100) : 0;
  return { out, removedPct, removedChars: removed };
}

