/**
 * Bloom_Prefilter - FIXED VERSION
 *
 * PROBLEM: Poprzednia implementacja dodawała pełne frazy do Bloom Filter,
 * ale testowała krótkie n-gramy (3-6 znaków). To nigdy nie mogło zadziałać,
 * bo Bloom Filter operuje na pełnych stringach, nie substringach.
 *
 * ROZWIĄZANIE: Opcja A (Performance-Optimized)
 * - Indeksuj wszystkie n-gramy z dangerous patterns
 * - Testuj n-gramy z input text
 * - To zapewnia spójność: te same typy stringów w obu operacjach
 *
 * ROZWIĄZANIE ALTERNATYWNE: Opcja B (Higher Accuracy)
 * - Indeksuj pełne frazy
 * - Testuj sliding windows różnych długości
 * - Wolniejsze, ale wykryje exact phrase matches
 */

class SimpleBloomFilter {
  constructor(size = 32768, k = 5, seed = 1337) {
    this.bits = new Uint8Array(size);
    this.size = size;
    this.k = k;
    this.seed = seed;
    this.itemCount = 0;
  }

  hash(str, seed) {
    let h = seed;
    for (let i = 0; i < str.length; i++) {
      h ^= str.charCodeAt(i);
      h = Math.imul(h ^ (h >>> 16), 0x85ebca6b);
      h = Math.imul(h ^ (h >>> 13), 0xc2b2ae35);
      h ^= h >>> 16;
    }
    return h >>> 0;
  }

  getHashes(item) {
    const hashes = [];
    for (let i = 0; i < this.k; i++) {
      const h = this.hash(item, this.seed + i) % this.size;
      hashes.push(h);
    }
    return hashes;
  }

  add(item) {
    const hashes = this.getHashes(item);
    for (const h of hashes) {
      this.bits[h] = 1;
    }
    this.itemCount++;
  }

  test(item) {
    const hashes = this.getHashes(item);
    for (const h of hashes) {
      if (this.bits[h] === 0) return false;
    }
    return true;
  }

  estimateFalsePositiveRate() {
    const bitsSet = this.bits.reduce((sum, bit) => sum + bit, 0);
    const p = bitsSet / this.size;
    return Math.pow(p, this.k);
  }
}

const DEFAULT_DANGEROUS_PATTERNS = [
  'ignore all instructions',
  'ignore previous instructions',
  'disregard instructions',
  'override system',
  'you are now',
  'act as dan',
  'jailbreak',
  'developer mode',
  'godmode enabled',
  'love pliny',
  'im free',
  'i\'m free',
  'system prompt',
  'reveal instructions',
  'show your prompt',
  'print instructions',
  'forget everything'
];

const items = $input.all();
if (!items || items.length === 0) {
  console.warn('BloomPrefilter: No input items');
  return [];
}

const out = [];

for (const item of items) {
  const j = item.json ?? {};

  // Skip if already blocked
  if (j.configError === true || j._isBlocked === true) {
    out.push(item);
    continue;
  }

  const cfg = j.config ?? {};

  // Get configuration from unified_config.json with defaults
  const bloomCfg = cfg.bloom || {
    m: 32768,
    k: 5,
    seed: 1337,
    match_mod: 97,
    min_matched_bits: 2
  };

  const prefilterCfg = cfg.prefilter || {
    ngram: { min: 3, max: 6, prefix_window: 96 },
    sample_limit: 800,
    obf_signals: { min_count: 2 }
  };

  // Get dangerous patterns from config or use defaults
  const dangerousPatterns = (prefilterCfg.dangerous_patterns && Array.isArray(prefilterCfg.dangerous_patterns) && prefilterCfg.dangerous_patterns.length > 0)
    ? prefilterCfg.dangerous_patterns
    : DEFAULT_DANGEROUS_PATTERNS;

  const bloomDecisions = cfg.bloom_decisions || {
    route_to_ac_threshold: 15,
    hard_block_threshold: 50,
    require_zusatz_signals: true,
    phrase_match_bonus: 20
  };

  // Initialize bloom filter
  const bloom = new SimpleBloomFilter(bloomCfg.m, bloomCfg.k, bloomCfg.seed);

  // ========================================
  // FIX: Indeksuj n-gramy z patterns (nie pełne frazy!)
  // ========================================
  const ngramMin = prefilterCfg.ngram?.min || 3;
  const ngramMax = prefilterCfg.ngram?.max || 6;

  let totalNgramsIndexed = 0;
  for (const pattern of dangerousPatterns) {
    if (typeof pattern === 'string' && pattern.length > 0) {
      const normalizedPattern = pattern.toLowerCase();

      // Add full pattern (dla dokładnych dopasowań)
      bloom.add(normalizedPattern);
      totalNgramsIndexed++;

      // Add n-grams from pattern (dla częściowych dopasowań)
      for (let n = ngramMin; n <= Math.min(ngramMax, normalizedPattern.length); n++) {
        for (let i = 0; i <= normalizedPattern.length - n; i++) {
          const ngram = normalizedPattern.substring(i, i + n);
          // Skipuj n-gramy składające się tylko ze spacji
          if (ngram.trim().length > 0) {
            bloom.add(ngram);
            totalNgramsIndexed++;
          }
        }
      }
    }
  }

  const text = j.normalization?.forScoring ?? j.chat_payload?.chatInput ?? "";
  const original = j.normalization?.original ?? "";

  // Skip if no text to analyze
  if (!text) {
    j.prefilter = {
      bloom: {
        matchedBitsCount: 0,
        totalHashes: 0,
        matchRatio: 0,
        suspiciousScore: 0,
        falsePositiveRate: bloom.estimateFalsePositiveRate(),
        patternsLoaded: dangerousPatterns.length,
        ngramsIndexed: totalNgramsIndexed,
        skipped: true,
        skipReason: 'no_text',
        version: 'FIXED_v1.0'
      },
      ngram: { sampledCount: 0 },
      routeToAC: false,
      hardBlock: false,
      signals: {}
    };
    item.json = j;
    out.push(item);
    continue;
  }

  // ========================================
  // FIX: Testuj zarówno n-gramy jak i sliding windows
  // ========================================
  const sampleLimit = prefilterCfg.sample_limit || 800;
  const testText = text.substring(0, sampleLimit).toLowerCase();

  let matchedNgrams = 0;
  let totalNgramTests = 0;
  let matchedPhrases = [];

  // Test 1: N-gram matching (fast, general detection)
  for (let n = ngramMin; n <= ngramMax; n++) {
    for (let i = 0; i <= testText.length - n; i++) {
      const ngram = testText.substring(i, i + n);
      totalNgramTests++;
      if (bloom.test(ngram)) {
        matchedNgrams++;
      }
    }
  }

  // Test 2: Phrase matching (slower, but catches exact phrases)
  // Testuj sliding windows od 10 do 50 znaków
  for (let windowSize = 10; windowSize <= Math.min(50, testText.length); windowSize += 5) {
    for (let i = 0; i <= testText.length - windowSize; i++) {
      const window = testText.substring(i, i + windowSize).trim();
      if (bloom.test(window)) {
        // Znaleźliśmy potencjalną frazę!
        // Sprawdź czy to jedna z known patterns
        for (const pattern of dangerousPatterns) {
          if (window.includes(pattern.toLowerCase())) {
            if (!matchedPhrases.includes(pattern)) {
              matchedPhrases.push(pattern);
            }
          }
        }
      }
    }
  }

  const ngramMatchRatio = totalNgramTests > 0 ? matchedNgrams / totalNgramTests : 0;

  // Additional cheap signals
  const hasZWSP = /[\u200B-\u200F\u202A-\u202E\u2060-\u206F\uFEFF]/.test(original);
  const longBase64 = /\b[A-Za-z0-9+/]{100,}={0,2}\b/.test(text);
  const hasTemplateMarkers = j.normalization?.obfuscationSignals?.includes("template-markers") || false;
  const hasSeparatorAbuse = j.normalization?.obfuscationSignals?.includes("separator-abuse") || false;

  // ========================================
  // FIX: Scoring z uwzględnieniem phrase matches
  // ========================================
  // Base score z n-gramów
  let suspiciousScore = ngramMatchRatio * 100;

  // Boost score jeśli znaleziono exact phrases
  if (matchedPhrases.length > 0) {
    // Każda znaleziona fraza dodaje konfigurowalne punkty
    const phraseBonus = bloomDecisions.phrase_match_bonus || 20;
    suspiciousScore += matchedPhrases.length * phraseBonus;
    // Cap at 100
    suspiciousScore = Math.min(100, suspiciousScore);
  }

  // Decision based on config thresholds
  // n-gram overlap is natural in normal language - need strong signal
  const routeToAC = (suspiciousScore > bloomDecisions.route_to_ac_threshold) ||
                    hasTemplateMarkers || hasSeparatorAbuse ||
                    matchedPhrases.length > 0;  // Route if any phrase matched

  const hardBlock = (suspiciousScore > bloomDecisions.hard_block_threshold) &&
                    (!bloomDecisions.require_zusatz_signals ||
                     (hasZWSP || longBase64 || matchedPhrases.length >= 2));

  j.prefilter = {
    bloom: {
      matchedBitsCount: matchedNgrams,
      totalHashes: totalNgramTests,
      matchRatio: ngramMatchRatio,
      suspiciousScore: Math.round(suspiciousScore),
      falsePositiveRate: bloom.estimateFalsePositiveRate(),
      patternsLoaded: dangerousPatterns.length,
      ngramsIndexed: totalNgramsIndexed,
      configSource: (prefilterCfg.dangerous_patterns && prefilterCfg.dangerous_patterns.length > 0) ? 'config' : 'defaults',
      version: 'FIXED_v1.0'
    },
    ngram: {
      sampledCount: Math.min(text.length, sampleLimit),
      ngramMin,
      ngramMax
    },
    phrases: {
      matchedCount: matchedPhrases.length,
      matched: matchedPhrases.slice(0, 5)  // Limit to first 5 for logging
    },
    routeToAC,
    hardBlock,
    signals: { hasZWSP, longBase64, hasTemplateMarkers, hasSeparatorAbuse },
    thresholdsUsed: {
      route_threshold: bloomDecisions.route_to_ac_threshold,
      block_threshold: bloomDecisions.hard_block_threshold,
      zusatz_required: bloomDecisions.require_zusatz_signals
    }
  };

  // If hard block detected, set decision early
  if (hardBlock) {
    j.decision = j.decision || {};
    j.decision.decision = 'BLOCK';
    j.decision.source = 'bloom_prefilter';
    j.decision.reason = 'HIGH_RISK_PATTERN_DETECTED';
    j.decision.details = {
      suspiciousScore: Math.round(suspiciousScore),
      matchedPhrases: matchedPhrases,
      signals: Object.keys(j.prefilter.signals).filter(k => j.prefilter.signals[k]),
      ngramMatchRatio: ngramMatchRatio,
      threshold: bloomDecisions.hard_block_threshold
    };
    j._isBlocked = true;
  }

  item.json = j;
  out.push(item);
}

return out;

